import React from 'react';
import Container from 'react-bootstrap/Container';
import { PageNotFound } from './404_styled';
import { connect } from 'react-redux';

const page_404 = () => {
    return (
        <PageNotFound themeStyle={props.themeStyle} theme={props.theme}>
            <Container>
                <div className='img-not-found img-responsive'>
                    page Not found
                </div>
            </Container>
        </PageNotFound>
    )
}

const mapStateToProps = state => ({
    themeStyle: state.theme.themeStyle,
    theme: state.theme.theme
});

export default connect(mapStateToProps)(page_404);
